import * as React from 'react';
import { Paper, Typography } from '@mui/material';

export default function Welcome() {
  return (
    <>
    <div className='root'>
      <Paper className='paper'>
        <Card className='card'>
          <CardContent>Hello World</CardContent>
        </Card>
      </Paper>
    </div>
    </>
  );
}
